                    My Resources page! - 17 Oct 19
                </ToastHeader>
                <ToastBody>
                ü§© I have finished my own resources page ‚Äî <a href="/resources" target="_blank">check it out!</a>
                </ToastBody>
                </Toast>
            </LimitToast>
        </div>


    </Wrapper>
    );
}

export default CheckResources;
